import React from "react";

import {
    StyledContainer,
    InnerContainer,
    pageLogo,
    pageTitle,
} from './../components/styles';

const Login = () => {
  return (
    <StyledContainer>
        <InnerContainer>
           
            <pageTitle>Student Placement System</pageTitle>
        </InnerContainer>
    </StyledContainer>
  )
}

export default Login;
